import { use } from "passport";
import React, { useEffect, useState } from "react";
import axios from "axios";


function Search() {

  datausr = {
    name: "casa"
  }

  axios
  .post("http://localhost:3000/api/consults/search", datausr)
  .then((res) => console.log(res.data))

  return <div></div>;
}

export default Search;
